import React, {useEffect, useState} from 'react';
import {Navbar, NavLink, Nav, NavbarBrand} from "react-bootstrap";
import NavbarCollapse from "react-bootstrap/NavbarCollapse";
import NavbarToggle from "react-bootstrap/NavbarToggle";
import {LinkArray} from "./LinkArray";
import {Link} from "react-router-dom";
import TabsPages from "./TabsPages";
import AccountNavBar from "../account/accountNavBar";



const NaviBar = () => {
    const [openPage, setOpenPage] = useState<string>("");

    const Children = ({path}: any) => {
        if (path === "/account") {
            return (
                <AccountNavBar/>
            );
        }
    }

    useEffect(() => {
        if(openPage !== "") Children({openPage});
    },[openPage])


    return (
        <>
            <Navbar collapseOnSelect expand={"xl"} bg={"dark"} variant={"dark"}>
                <NavbarBrand>World of Bee</NavbarBrand>
                <NavbarToggle aria-controls={"responsive-navbar-nav"}/>
                <NavbarCollapse  id={"responsive-navbar-nav"}>
                    <Nav justify variant="tabs" defaultActiveKey="/home">
                    <>{LinkArray.map(link =>
                            <NavLink eventKey={link.path} onClick={() => setOpenPage(link.path)}>
                                <Link to={link.path}>{link.component}</Link>
                            </NavLink>
                    )}</>
                    </Nav>
                </NavbarCollapse>
            </Navbar>
            <TabsPages children={Children}/>
        </>
    );
};

export default NaviBar;
